import './App.css';
import './product.css';
import { BrowserRouter as Switch, Router, Route} from 'react-router-dom';
import Home from './pages/Home';
import Product from './pages/Product';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={home} />
        <Route path="/product" component={product} />
      </Switch>
    </Router>
  );
}

export default App;
